import { useEffect, useState } from "react";

export default function HostCarPricing() {
    const [car, setCar] = useState(0);
    useEffect(() => {
        const res = JSON.parse(localStorage.getItem("cars"));
        const data = res.filter(c => c.id === "1" && c.hostId === "1");
        setCar(data[0]);
    }, []);
    return (
        <p>${ car.price }/day</p>
    );
};
